/* eslint-disable no-undef */
import React from "react";
import { Badge } from "react-bootstrap";
import { Testimonials } from "../dataProduct/dataProduct";

const TestimonialBadge = ({ testimonial }) => {
  const { badGe } = testimonial; 

  <Badge bg="secondary">{badGe}</Badge>;
};

module.export= TestimonialBadge;




export default  function TestimonialButton () {
  return (
    <div className="Testimonial_button">
      {Testimonials.map(( testimonial , index) => (
        <TestimonialBadge key={index} testimonial={testimonial}/>
      ))}

    </div>

  );
}
